import React from "react";
import styled from "styled-components";
import { ButtonGreen, ButtonRed } from "../atoms/Button";

const Container = styled.div``;

const SerchTop = styled.div`
  display: flex;
  align-items: center;
`;
const SerchText = styled.input`
  padding: 6px 4px;
  margin: 0 10px;
  width: 100%;
  border-radius: 6px;
`;
const Buttons = styled.div`
  display: flex;
`;
const Title = styled.h2``;

const Issue = () => {
  return (
    <Container>
      <SerchTop>
        <Title>Issue</Title>
        <SerchText placeholder="issue名で検索"></SerchText>
        <Buttons>
          <ButtonGreen>New</ButtonGreen>
          <ButtonRed>Dlete</ButtonRed>
        </Buttons>
      </SerchTop>
    </Container>
  );
};

export default Issue;
